export class personType {
  static getAllPersonTypes() {
    return [
      { id: 1, title: 'Student', isSelected: false },
      { id: 2, title: 'Faculty', isSelected: false },
      { id: 3, title: 'Professional', isSelected: false },
    ];
  }
}
